import React, { useState } from 'react';
import { 
  Box, 
  Avatar, 
  Typography, 
  Grid, 
  IconButton, 
  Tooltip, 
  Chip, 
  Button, 
  CircularProgress 
} from '@mui/material';
import {
  CheckCircle as CheckCircleIcon,
  Warning as WarningIcon,
  ContentCopy as ContentCopyIcon,
  OpenInNew as OpenInNewIcon,
  Check as CheckIcon,
  ErrorOutline as ErrorOutlineIcon,
  Refresh as RefreshIcon
} from '@mui/icons-material';

const TokenInformation = ({ tokenAddress }) => {
  const [tokenInfo, setTokenInfo] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [copySuccess, setCopySuccess] = useState(false);

  // Keep existing useEffect and data fetching logic

  const handleCopyAddress = async () => {
    try {
      await navigator.clipboard.writeText(tokenAddress);
      setCopySuccess(true);
      setTimeout(() => setCopySuccess(false), 2000);
    } catch (err) {
      console.error('Failed to copy:', err);
    }
  };

  if (loading) return (
    <Box sx={{ 
      display: 'flex', 
      justifyContent: 'center', 
      alignItems: 'center',
      height: '200px' 
    }}>
      <CircularProgress size={24} />
    </Box>
  );

  if (error) return (
    <Box sx={{ 
      p: 3, 
      textAlign: 'center',
      bgcolor: 'error.lighter',
      borderRadius: 2,
      border: 1,
      borderColor: 'error.light'
    }}>
      <ErrorOutlineIcon color="error" sx={{ fontSize: 40, mb: 1 }} />
      <Typography color="error.main" gutterBottom>
        {error}
      </Typography>
      <Button 
        startIcon={<RefreshIcon />}
        onClick={() => setTokenInfo(null)}
        size="small"
        sx={{ mt: 1 }}
      >
        Retry
      </Button>
    </Box>
  );

  if (!tokenInfo) return null;

  return (
    <Box>
      {/* Token Header */}
      <Box sx={{ 
        display: 'flex', 
        alignItems: 'center', 
        gap: 2,
        mb: 3
      }}>
        {tokenInfo?.logoURI && (
          <Avatar 
            src={tokenInfo.logoURI} 
            alt={tokenInfo.symbol}
            sx={{ 
              width: 48, 
              height: 48,
              border: 1,
              borderColor: 'divider'
            }}
          />
        )}
        <Box sx={{ flex: 1 }}>
          <Typography variant="h6" sx={{ fontWeight: 600 }}>
            {tokenInfo?.symbol}
          </Typography>
          <Typography variant="body2" color="text.secondary">
            {tokenInfo?.name}
          </Typography>
        </Box>
      </Box>

      {/* Token Address */}
      <Box sx={{ 
        mb: 3,
        p: 2,
        bgcolor: 'background.default',
        borderRadius: 2,
        border: 1,
        borderColor: 'divider'
      }}>
        <Typography variant="caption" color="text.secondary" gutterBottom>
          Token Address
        </Typography>
        <Box sx={{ 
          display: 'flex', 
          alignItems: 'center',
          gap: 1,
          mt: 0.5
        }}>
          <Typography 
            variant="body2" 
            sx={{ 
              fontFamily: 'monospace',
              flex: 1
            }}
          >
            {`${tokenAddress.slice(0, 8)}...${tokenAddress.slice(-8)}`}
          </Typography>
          <Tooltip title="Copy Address">
            <IconButton 
              size="small" 
              onClick={handleCopyAddress}
              sx={{ color: copySuccess ? 'success.main' : 'action.active' }}
            >
              {copySuccess ? <CheckIcon /> : <ContentCopyIcon />}
            </IconButton>
          </Tooltip>
          <Tooltip title="View on Explorer">
            <IconButton 
              size="small"
              component="a"
              href={`https://solscan.io/token/${tokenAddress}`}
              target="_blank"
              rel="noopener noreferrer"
            >
              <OpenInNewIcon />
            </IconButton>
          </Tooltip>
        </Box>
      </Box>

      {/* Token Details */}
      <Grid container spacing={2}>
        <Grid item xs={6}>
          <Box sx={{ 
            p: 2,
            bgcolor: 'background.default',
            borderRadius: 2,
            border: 1,
            borderColor: 'divider',
            height: '100%'
          }}>
            <Typography variant="caption" color="text.secondary">
              Decimals
            </Typography>
            <Typography variant="h6" sx={{ mt: 0.5, fontWeight: 600 }}>
              {tokenInfo?.decimals || 'N/A'}
            </Typography>
          </Box>
        </Grid>
        <Grid item xs={6}>
          <Box sx={{ 
            p: 2,
            bgcolor: 'background.default',
            borderRadius: 2,
            border: 1,
            borderColor: 'divider',
            height: '100%'
          }}>
            <Typography variant="caption" color="text.secondary">
              Created
            </Typography>
            <Typography variant="h6" sx={{ mt: 0.5, fontWeight: 600 }}>
              {tokenInfo?.created_at ? new Date(tokenInfo.created_at).toLocaleDateString() : 'N/A'}
            </Typography>
          </Box>
        </Grid>
      </Grid>

      {/* Security Status */}
      <Box sx={{ mt: 3 }}>
        <Typography variant="subtitle2" gutterBottom sx={{ fontWeight: 600 }}>
          Security Status
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Box sx={{ 
              p: 2,
              bgcolor: !tokenInfo?.mint_authority ? 'success.lighter' : 'error.lighter',
              borderRadius: 2,
              border: 1,
              borderColor: !tokenInfo?.mint_authority ? 'success.light' : 'error.light'
            }}>
              <Box sx={{ 
                display: 'flex', 
                alignItems: 'center', 
                gap: 1,
                color: !tokenInfo?.mint_authority ? 'success.dark' : 'error.dark'
              }}>
                {!tokenInfo?.mint_authority ? (
                  <CheckCircleIcon fontSize="small" />
                ) : (
                  <WarningIcon fontSize="small" />
                )}
                <Typography variant="body2">
                  Mint Authority
                </Typography>
              </Box>
            </Box>
          </Grid>
          <Grid item xs={6}>
            <Box sx={{ 
              p: 2,
              bgcolor: !tokenInfo?.freeze_authority ? 'success.lighter' : 'error.lighter',
              borderRadius: 2,
              border: 1,
              borderColor: !tokenInfo?.freeze_authority ? 'success.light' : 'error.light'
            }}>
              <Box sx={{ 
                display: 'flex', 
                alignItems: 'center', 
                gap: 1,
                color: !tokenInfo?.freeze_authority ? 'success.dark' : 'error.dark'
              }}>
                {!tokenInfo?.freeze_authority ? (
                  <CheckCircleIcon fontSize="small" />
                ) : (
                  <WarningIcon fontSize="small" />
                )}
                <Typography variant="body2">
                  Freeze Authority
                </Typography>
              </Box>
            </Box>
          </Grid>
        </Grid>
      </Box>

      {/* Tags */}
      {tokenInfo?.tags && tokenInfo.tags.length > 0 && (
        <Box sx={{ mt: 3 }}>
          <Typography variant="subtitle2" gutterBottom sx={{ fontWeight: 600 }}>
            Tags
          </Typography>
          <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
            {tokenInfo.tags.map((tag, index) => (
              <Chip 
                key={index}
                label={tag}
                size="small"
                sx={{ 
                  bgcolor: 'background.default',
                  borderRadius: 1,
                  '& .MuiChip-label': {
                    px: 1,
                    fontWeight: 500
                  }
                }}
              />
            ))}
          </Box>
        </Box>
      )}
    </Box>
  );
};

export default TokenInformation;
